HostAppNameMixin.description:
This mixin provides an attribute that holds the host app name, and is intended to be used with other ember-osf components.

Sample usage:
```
// components/componentA.js
import hostAppName from ember-osf/mixins/host-app-name;

export default Component.extend(hostAppName);
```

```
// components/ComponentB.js
import hostAppName from ember-osf/mixins/host-app-name;

export default Component.extend(hostAppName);

```
The above example will result in both component A and component B sharing the same attribute hostAppName.

fixstring.description:
Custom string field transform that uses the `fix-special-char` utility function to clean up malformed text sent
from the server. This allows string fields to be correctly and transparently used in templates without manually fixing
these characters for display on each use.

 This transform is used when `fixstring` is passed as the type parameter to the DS.attr function.
  ```app/models/score.js
   import DS from 'ember-data';
   export default DS.Model.extend({
      astring: DS.attr('fixstring'),
   });
 ```

